import React, { Component } from 'react'
import { Row } from 'react-bootstrap';

//Planten Pagina
export class Planten extends Component {
    // comment
    getPlants = async () => {
        try {
          return await axios.get('https://europe-west1-smartbroeikas.cloudfunctions.net/api/getplants')
        } catch (error) {
          console.error(error)
        }
    }

    logPlants = async () => {
        const plants = getPlants()
          .then(response => {
            if (response.data.message) {
              console.log(response.data.message);
            }
          })
          .catch(error => {
            console.log(error)
          })
      }
      
      componentWillMount() {
        logPlants()
      }


    render() {
        console.log(this.props.userData);
        return (
            <div>
                <h2>Gegevens</h2>
                <Row>
                    <div className="col">E-mail adres:</div>
                    <div className="col">{this.props.userData.name}</div>            
                </Row>
                <Row>
                    <div className="col">Locatie:</div>
                    <div className="col">{this.props.userData.location}</div>            
                </Row>
                <Row>
                    <div className="col">Biography:</div>
                    <div className="col">{this.props.userData.bio}</div>            
                </Row>
            </div>
        )
    }
}

export default Planten
